description:
Tom Cutler (Samuel L. Jackson) es un ex policia que ahora se dedica a limpiar escenas de crimenes una vez que ya han sido investigados. Concienzudo y metodico, no deja jamas rastro alguno que pueda indicar que haya ocurrido una tragedia en ese lugar. Cuando recibe el encargo de limpiar la escena de un brutal asesinato acaecido en un barrio de clase alta, lo encara como un trabajo mas... hasta que se da cuenta de que nadie ha comunicado el crimen a la policia y que lo que ha hecho es eliminar toda evidencia del mismo.
